import { Link } from 'react-router-dom';

function LogoutLink(props) {
	return (
         <li className="sidebar-item"> <a className="sidebar-link sidebar-link" href="/login"
         aria-expanded="false"><span
             className="hide-menu">
                 Login
             </span></a>
     </li>

	);
}

export default LogoutLink;
